    "refuge-narrative-report-september-to-december-1961-kodiak-national-wildlife-refuge",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Kodiak NWR outlines
    Refuge accomplishments from September through December of 1961. The report begins
    by summarizing the weather conditions, habitat conditions, water conditions, and
    food and cover during this period. Wildlife- including migratory birds, upland game
    birds, big game animals, furbearers, rodents, mammals, raptors, and fish- is also
    covered. The Refuge development and maintenance section discusses physical developments
    and collections and receipts. A progress report on field investigations and applied
    research is also provided. The public relations section of the report describes
    recreational uses, Refuge visitors, Refuge participation, hunting, and violations.
    Items of interest, N-R forms, and photographs are attached.",nt"license_title":
